(function(){var loadHandler=window['sl_{ED5C0895-2F65-4EC0-9B68-BAED753C712B}'];loadHandler&&loadHandler(1, '<div id="spr0_11414f6b"><div id="spr1_11414f6b" class="kern slide"><img id="img1_11414f6b" src="data:image/png;base64," width="1021px" height="680px" alt="" style="left:0px;top:0px;"/><div id="spr3_11414f6b" style="top:0px;"><div id="spr4_11414f6b"><img id="img0_11414f6b" src="data:image/png;base64," width="1021" height="679.666" alt="" style="left:0px;top:0.125px;"/></div></div></div><div id="spr2_11414f6b" class="kern slide"><div id="spr5_11414f6b" style="left:27.18px;top:6.573px;"><div style="width:0px;"><span id="txt0_11414f6b" data-width="309.098480" style="left:9.605px;top:10.644px;">Overview And</span></div><div style="width:0px;"><span id="txt1_11414f6b" data-width="437.889526" style="left:9.605px;top:61.819px;">Course Objectives</span></div></div><div id="spr6_11414f6b" style="left:27.18px;top:132.329px;"><div style="width:0px;"><span id="txt2_11414f6b" data-width="382.254028" style="left:9.605px;top:1.763px;">While making a choice among different</span></div><div style="width:0px;"><span id="txt3_11414f6b" data-width="356.684540" style="left:9.605px;top:30.549px;">financial products for the purpose of</span></div><div style="width:0px;"><span id="txt4_11414f6b" data-width="402.915771" style="left:9.605px;top:59.335px;">investment, it is important to understand</span></div><div style="width:0px;"><span id="txt5_11414f6b" data-width="364.942200" style="left:9.605px;top:88.121px;">the difference in tax treatment of the</span></div><div style="width:0px;"><span id="txt6_11414f6b" data-width="344.409302" style="left:9.605px;top:116.907px;">incomes they generate. This course</span></div><div style="width:0px;"><span id="txt7_11414f6b" data-width="403.302307" style="left:9.605px;top:145.693px;">examines the incomes generated by each</span></div><div style="width:0px;"><span id="txt8_11414f6b" data-width="381.773804" style="left:9.605px;top:174.478px;">financial product, and discusses the tax</span></div><div style="width:0px;"><span id="txt9_11414f6b" data-width="387.958252" style="left:9.605px;top:203.264px;">implications of each investment income</span></div><div style="width:0px;"><span id="txt10_11414f6b" style="left:396.888px;top:203.264px;">:</span></div><div style="width:0px;"><span id="txt11_11414f6b" data-width="400.034363" style="left:9.605px;top:232.05px;">dividend, interest and capital gain. It also</span></div><div style="width:0px;"><span id="txt12_11414f6b" data-width="382.640564" style="left:9.605px;top:260.836px;">covers concepts relating to tax aspects:</span></div><div style="width:0px;"><span id="txt13_11414f6b" data-width="369.955383" style="left:9.605px;top:289.622px;">indexation, long and short term gains,</span></div><div style="width:0px;"><span id="txt14_11414f6b" data-width="157.176865" style="left:9.605px;top:318.408px;">set off of losses.</span></div></div><div id="spr7_11414f6b" style="left:27.18px;top:490.823px;"><div style="width:0px;"><span id="txt15_11414f6b" data-width="656.572693" style="left:9.605px;top:1.763px;">The course is covered in five modules. At the end of the course, the</span></div><div style="width:0px;"><span id="txt16_11414f6b" data-width="367.261383" style="left:9.605px;top:30.549px;">learner is expected to understand the</span></div><div style="width:0px;"><span id="txt17_11414f6b" data-width="269.469482" style="left:381.794px;top:30.549px;">taxation aspects of four key</span></div><div style="width:0px;"><span id="txt18_11414f6b" data-width="726.885864" style="left:9.605px;top:59.335px;">categories of financial products - deposits, bonds, mutual funds and equity</span></div><div style="width:0px;"><span id="txt19_11414f6b" data-width="663.623901" style="left:9.605px;top:88.121px;">and derivatives. The learner will be able to differentiate the types of</span></div><div style="width:0px;"><span id="txt20_11414f6b" data-width="707.149475" style="left:9.605px;top:116.907px;">income, exemptions and deductions, and tax treatment of each product.</span></div></div></div></div>', '{"s":[]}');})();